import React, {Component, Fragment} from 'react'
import DeskTopLayout from '../../components/layouts/deskTopLayout'

class Index extends Component {
  render() {

    return (
      <Fragment>
        <DeskTopLayout>
          <h1>關於卡利</h1>
        </DeskTopLayout>
      </Fragment>

    )
  }
}

export default Index
